import React, {Component} from 'react';
import './Button.css';

class Button extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <button type="button" className="btn btn-primary">
      Primary
      </button>
    );  
  }
}

export default Button;
